import React from 'react';
import PropTypes from 'prop-types';


const LogItem = ({ log }) => {
    console.log(log.message);

    return (
        <li className="collection-item">
            <div>
                <li> {log.massage} </li>
            </div>
        </li>
    );
};

LogItem.propTypes = {
    log: PropTypes.object.isRequired
}

export default LogItem;
